import React from 'react';
import './App.css';
import Banner from "./components/Banner";


function App() {

  return (
    <div className="App">
      <Banner name='greg'/>
      <Banner name='steve'/>
      <Banner name='bernie'/>
    </div>
  );
}

export default App;
